script: |
  super -f text -I q8632.spq | sort > q8632.out

inputs:
  - name: q8632.spq
    data: |
      SELECT - - ( col0 ) * cor0.col0 * + cor0.col2 + + col0 * 30 * + col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q8632.out
    data: |
      103075
      80928
      892492
